  A[1] = Q6*(A10061*R + A10081*Q2*R) + dth2*(Q4*(A10241*R + A10261*Q2*R) + dth2*(Q2*(A10421*R + A10441*Q2*R) + dth2*(A10601*R + A10801*dth2*R + A10621*Q2*R))) + dr*(A11061*Q6*R + dth2*(A11241*Q4*R + dth2*(A11601*dth2*R + A11421*Q2*R)) + dr*(Q4*(A12041*R + A12061*Q2*R) + dth2*(Q2*(A12221*R + A12241*Q2*R) + dth2*(A12401*R + A12601*dth2*R + A12421*Q2*R)) + dr*(A13041*Q4*R + dth2*(A13401*dth2*R + A13221*Q2*R) + dr*(Q2*(A14021*R + A14041*Q2*R) + dth2*(A14201*R + A14401*dth2*R + A14221*Q2*R) + dr*(A15201*dth2*R + A15021*Q2*R + dr*(A16001*R + A16201*dth2*R + A16021*Q2*R + dr*(A17001*R + A18001*dr*R)))))));
  A[2] = dth*(A20161*Q6*R + dth2*(A20341*Q4*R + dth2*(A20701*dth2*R + A20521*Q2*R))) + dr*(dth*(A21161*Q6*R + dth2*(A21341*Q4*R + dth2*(A21701*dth2*R + A21521*Q2*R))) + dr*(dth*(A22141*Q4*R + dth2*(A22501*dth2*R + A22321*Q2*R)) + dr*(dth*(A23141*Q4*R + dth2*(A23501*dth2*R + A23321*Q2*R)) + dr*(dth*(A24301*dth2*R + A24121*Q2*R) + dr*(dr*(A26101*dth*R + A27101*dr*dth*R) + dth*(A25301*dth2*R + A25121*Q2*R))))));
