  A[6] = Q6*(A60061*R + A60081*Q2*R) + dth2*(Q4*(A60241*R + A60261*Q2*R) + dth2*(Q2*(A60421*R + A60441*Q2*R) + dth2*(A60601*R + A60801*dth2*R + A60621*Q2*R))) + dr*(A61061*Q6*R + dth2*(A61241*Q4*R + dth2*(A61601*dth2*R + A61421*Q2*R)) + dr*(Q4*(A62041*R + A62061*Q2*R) + dth2*(Q2*(A62221*R + A62241*Q2*R) + dth2*(A62401*R + A62601*dth2*R + A62421*Q2*R)) + dr*(A63041*Q4*R + dth2*(A63401*dth2*R + A63221*Q2*R) + dr*(Q2*(A64021*R + A64041*Q2*R) + dth2*(A64201*R + A64401*dth2*R + A64221*Q2*R) + dr*(A65201*dth2*R + A65021*Q2*R + dr*(A66001*R + A66201*dth2*R + A66021*Q2*R + dr*(A67001*R + A68001*dr*R)))))));
  A[7] = dth2*(dth2*(dth2*(A70800*dth2 + A70620*Q2) + A70440*Q4) + A70260*Q6) + A70080*Q8 + dr*(dth2*(dth2*(dth2*(A71800*dth2 + A71620*Q2) + A71440*Q4) + A71260*Q6) + dr*(dth2*(dth2*(A72600*dth2 + A72420*Q2) + A72240*Q4) + A72060*Q6 + dr*(dth2*(dth2*(A73600*dth2 + A73420*Q2) + A73240*Q4) + dr*(dth2*(A74400*dth2 + A74220*Q2) + A74040*Q4 + dr*(dth2*(A75400*dth2 + A75220*Q2) + dr*(A76200*dth2 + A76020*Q2 + dr*(dr*(A78000 + A79000*dr) + A77200*dth2 + A77020*Q2)) + A75040*Q4)) + A73060*Q6)) + A71080*Q8);
  A[8] = dth*(A80161*Q6*R + dth2*(A80341*Q4*R + dth2*(A80701*dth2*R + A80521*Q2*R))) + dr*(dth*(A81161*Q6*R + dth2*(A81341*Q4*R + dth2*(A81701*dth2*R + A81521*Q2*R))) + dr*(dth*(A82141*Q4*R + dth2*(A82501*dth2*R + A82321*Q2*R)) + dr*(dth*(A83141*Q4*R + dth2*(A83501*dth2*R + A83321*Q2*R)) + dr*(dth*(A84301*dth2*R + A84121*Q2*R) + dr*(dr*(A86101*dth*R + A87101*dr*dth*R) + dth*(A85301*dth2*R + A85121*Q2*R))))));
  A[9] = dth2*(dth2*(Q2*(A90420 + A90440*Q2) + dth2*(A90600 + A90800*dth2 + A90620*Q2)) + (A90240 + A90260*Q2)*Q4) + (A90060 + A90080*Q2)*Q6 + dr*(dth2*(dth2*(Q2*(A91420 + A91440*Q2) + dth2*(A91600 + A91800*dth2 + A91620*Q2)) + (A91240 + A91260*Q2)*Q4) + dr*(dth2*(Q2*(A92220 + A92240*Q2) + dth2*(A92400 + A92600*dth2 + A92420*Q2)) + (A92040 + A92060*Q2)*Q4 + dr*(dth2*(Q2*(A93220 + A93240*Q2) + dth2*(A93400 + A93600*dth2 + A93420*Q2)) + dr*(Q2*(A94020 + A94040*Q2) + dth2*(A94200 + A94400*dth2 + A94220*Q2) + dr*(Q2*(A95020 + A95040*Q2) + dth2*(A95200 + A95400*dth2 + A95220*Q2) + dr*(A96000 + A96200*dth2 + A96020*Q2 + dr*(A97000 + dr*(A98000 + A99000*dr) + A97200*dth2 + A97020*Q2)))) + (A93040 + A93060*Q2)*Q4)) + (A91060 + A91080*Q2)*Q6);

  s2 = alpha20*dr2 + alpha02*dth2 + beta*Q2;
